      'p3': '\u0647\u0646\u0627\u0643 \u0628\u0639\u0636 \u0627\u0644\u0627\u0645\u062b\u0644\u0629 \u0639\u0646 \u0647\u0630\u0629 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062a:',
      'l1': '\u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0627\u0644\u062a\u064a \u062a\u062a\u064a\u062d \u0644\u0646\u0627  \u0627\u0644\u062a\u0648\u0627\u0635\u0644 \u0645\u0639\u0643 \u0633\u0648\u0627 \u0643\u0627\u0646\u062a \u0639\u0646 \u0637\u0631\u064a\u0642 \u0627\u0644\u0647\u0627\u062a\u0641 \u0627\u0644\u0645\u062d\u0645\u0648\u0644 \u0627\u0648 \u0639\u0646 \u0637\u0631\u064a\u0642 \u0627\u0644\u0628\u0631\u064a\u062f \u0627\u0644\u0627\u0644\u0643\u062a\u0631\u0648\u0646\u064a',
