      'p4': '\u0646\u062c\u0645\u0639 \u0646\u0648\u0639\u064a\u0646 \u0645\u0646 \u0628\u064a\u0627\u0646\u0627\u062a \u0627\u0644\u0639\u0645\u0644\u0627\u0621',
      'l3': '.\u062a\u0644\u0643 \u0627\u0644\u062a\u064a \u062a\u0642\u0648\u0645 \u0628\u0625\u062f\u062e\u0627\u0644\u0647\u0627 \u0623\u062b\u0646\u0627\u0621 \u0639\u0645\u0644\u064a\u0629 \u062a\u0633\u062c\u064a\u0644 \u0627\u0644\u062f\u062e\u0648\u0644 \u0625\u0644\u0649 \u0627\u0644\u062d\u0633\u0627\u0628',
      'l4': '\u0627\u0644\u062a\u064a \u064a\u062a\u0645 \u0625\u0646\u0634\u0627\u0624\u0647\u0627 \u0645\u0646 \u062e\u0644\u0627\u0644 \u0627\u0633\u062a\u062e\u062f\u0627\u0645\u0643 \u0644\u0644\u0639\u0645\u0644\u064a\u0627\u062a.    \u0645\u0648\u0627\u0642\u0639\u0646\u0627 \u0639\u0644\u0649 \u0627\u0644\u0648\u064a\u0628 \u0648\u0645\u0646\u062a\u062c\u0627\u062a\u0646\u0627 \u0648\u062e\u062f\u0645\u0627\u062a\u0646\u0627.',
      'p5': '\u0642\u062f \u0646\u0633\u062a\u062e\u062f\u0645 \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0644\u0644\u0645\u062c\u0645\u0648\u0639\u0629 \u0645\u062a\u0646\u0648\u0639\u0629 \u0645\u0646 \u0627\u0644\u0627\u063a\u0631\u0627\u0636 \u0628\u0645\u0627 \u0641\u064a \u0630\u0644\u0643',
      'l5': '\u062a\u0642\u062f\u064a\u0645 \u0627\u0641\u0636\u0644 \u062a\u062c\u0627\u0631\u0628 \u0644\u0644\u062e\u062f\u0645\u0629 \u0627\u0644\u0639\u0645\u0644\u0627\u0621 \u0627\u0644\u0643\u0631\u0627\u0645',
      'l6': '\u062a\u0642\u062f\u064a\u0645 \u0627\u0641\u0636\u0644 \u0648\u0627\u0633\u0631\u0639 \u062e\u062f\u0645\u0629 \u0627\u0644\u0627\u062a\u0635\u0627\u0644 \u0648\u0627\u0644\u0631\u062f \u0627\u0644\u0645\u0628\u0627\u0634\u0631',
