      'h3': '\u062a\u063a\u064a\u064a\u0631\u0627\u062a \u0639\u0644\u0649 \u0633\u064a\u0627\u0633\u0629 \u0627\u0644\u062e\u0635\u0648\u0635\u064a\u0629',
      'p7': '\u064a\u062d\u062a\u0641\u0638 \u0643\u0644\u0648\u0628 \u0641\u0627\u0643\u062a\u0648\u0631\u064a \u0628\u0627\u0644\u062d\u0642 \u0641\u064a \u062a\u0639\u062f\u064a\u0644 \u0623\u0648 \u062a\u063a\u064a\u064a\u0631 \u0633\u064a\u0627\u0633\u0629 \u0627\u0644\u062e\u0635\u0648\u0635\u064a\u0629 \u0647\u0630\u0647 \u060c \u0648\u0641\u0642\u0622 \u0645\u0627\u0646\u0631\u0627\u0629 \u0645\u0646\u0627\u0633\u0628\u064b\u0627 \u060c \u0648\u0630\u0644\u0643 \u0628\u0633\u0628\u0628 \u0645\u062a\u0637\u0644\u0628\u0627\u062a \u0627\u0644\u0627\u0645\u062a\u062b\u0627\u0644 \u0627\u0644\u0642\u0627\u0646\u0648\u0646\u064a\u0629 \u0623\u0648 \u0627\u0644\u062a\u063a\u064a\u064a\u0631\u0627\u062a \u0627\u0644\u062a\u064a \u062a\u0637\u0631\u064a \u0639\u0644\u0649 \u0645\u0645\u0627\u0631\u0633\u0629 \u0623\u0639\u0645\u0627\u0644\u0646\u0627. \u0625\u0630\u0627 \u0642\u062f\u0645\u062a \u0644\u0646\u0627 \u0639\u0646\u0648\u0627\u0646 \u0628\u0631\u064a\u062f \u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a \u060c \u0641\u0633\u0648\u0641 \u0646\u0633\u0639\u0649 \u0625\u0644\u0649 \u0625\u0639\u0644\u0627\u0645\u0643 \u060c \u0639\u0646 \u0637\u0631\u064a\u0642 \u0627\u0644\u0628\u0631\u064a\u062f \u0627\u0644\u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a \u0625\u0644\u0649 \u0630\u0644\u0643 \u0627\u0644\u0639\u0646\u0648\u0627\u0646 \u060c \u0628\u0623\u064a \u062a\u063a\u064a\u064a\u0631 \u062c\u0648\u0647\u0631\u064a \u0641\u064a \u0643\u064a\u0641\u064a\u0629 \u0627\u0633\u062a\u062e\u062f\u0627\u0645\u0646\u0627 \u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0627\u0644\u062a\u0639\u0631\u064a\u0641 \u0627\u0644\u0634\u062e\u0635\u064a\u0629.',
      'h4': '\u0644\u0644\u062a\u0648\u0627\u0635\u0644 \u0628\u0646\u0627',
      'p8': '\u0625\u0630\u0627 \u0643\u0627\u0646\u062a \u0644\u062f\u064a\u0643 \u0623\u064a \u0623\u0633\u0626\u0644\u0629 \u0623\u0648 \u062a\u0639\u0644\u064a\u0642\u0627\u062a \u062d\u0648\u0644 \u0647\u0630\u0647 \u0627\u0644\u0633\u064a\u0627\u0633\u0629 \u0623\u0648 \u0625\u0630\u0627 \u0643\u0646\u062a \u062a\u0631\u064a\u062f \u0645\u0646\u0627 \u062a\u062d\u062f\u064a\u062b \u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062a \u0627\u0644\u062a\u064a \u0646\u062d\u062a\u0641\u0638 \u0628\u0647\u0627 \u0639\u0646\u0643 \u0623\u0648 \u0645\u0633\u0627\u0639\u062f\u062a\u0643 \u0639\u0644\u0649 \u0636\u0628\u0637 \u062a\u0641\u0636\u064a\u0644\u0627\u062a\u0643 \u060c \u064a\u0631\u062c\u0649 \u0627\u0644\u062a\u0648\u0627\u0635\u0644 \u0645\u0639\u0646\u0627 \u0639\u0628\u0631 \u0627\u0644\u0628\u0631\u064a\u062f \u0627\u0644\u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a \u0639\u0644\u0649 info@fromfactory.club.'
